import React from 'react'
import './Navigation.css'
import Logo from './Logo'
import world_img from '../images/world_img.png'
import { useTranslation } from 'react-i18next';
const Navigation = () => {
	const { t } = useTranslation();
	return (
		<nav className='Navbar'>
			<Logo />
			<a href='#' className='Artificialintelligence'>{t("Artificial_msg")}</a>
			<a href='#' className='Home'>{t("Home_msg")}</a>
			<a href='#' className='About'>{t("About_msg")}</a>
			<a href='#' className='Services'>({t("About_msg")})</a>
			<a href='#' className='Blog'>{t("Blog_msg")}</a>
			<a href='#' className='Contact'>{t("Contact_msg")}</a>
			<btn className='world_logo'><button> <img src={world_img} alt="world" /></button></btn>
			<btn className='Log_in'><a href='#'>{t}</a></btn>
		</nav>
	)
}
export default Navigation;
